DELIMITER $$

/*!50106 CREATE DEFINER=`root`@`localhost` EVENT `e_save_record_history` ON SCHEDULE EVERY 1 DAY STARTS '2011-04-12 17:00:00' ON COMPLETION NOT PRESERVE ENABLE COMMENT 'Luu ho so dang xu ly vao 17h hang ngay' DO BEGIN
        CALL sp_control_save_history_stat();
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_control_save_history_stat` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_control_save_history_stat` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_control_save_history_stat`()
BEGIN
	DECLARE v_spec_code VARCHAR(100);
	DECLARE done INT DEFAULT FALSE;
	
	DECLARE cur_spec CURSOR
	FOR SELECT ls.C_CODE
	FROM t_cores_listtype lt 
	INNER JOIN t_cores_list ls
	ON lt.PK_LISTTYPE = ls.FK_LISTTYPE
	WHERE lt.C_CODE = 'DANH_MUC_LINH_VUC';
	
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
	
	OPEN cur_spec;
	
	DELETE FROM t_r3_record_history_stat WHERE DATEDIFF(NOW(), C_HISTORY_DATE)=0;
	
	spec_loop: LOOP
		FETCH cur_spec INTO v_spec_code;
		IF done THEN
			LEAVE spec_loop;
		END IF;
		CALL sp_save_record_history_stat(v_spec_code);
	END LOOP;
	CLOSE cur_spec;
  
    END */$$
DELIMITER ;

