/* Procedure structure for procedure `sp_save_record_history_stat` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_save_record_history_stat` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_save_record_history_stat`(v_spec_code VARCHAR(20))
BEGIN
	DECLARE v_tong_tiep_nhan INT;
	DECLARE v_tong_tiep_nhan_trong_thang INT;
	DECLARE v_dang_thu_ly INT;
	DECLARE v_dang_cho_tra_kq INT;
	DECLARE v_da_tra_kq INT;
	DECLARE v_da_tra_kq_truoc_han INT;
	DECLARE v_da_tra_kq_dung_han INT;
	DECLARE v_da_tra_kq_qua_han INT;
	DECLARE v_dang_thu_ly_dung_tien_do INT;
	DECLARE v_dang_thu_ly_cham_tien_do INT;
	DECLARE v_phai_bo_sung INT;
	DECLARE v_thu_ly_qua_han INT;
	DECLARE v_cong_dan_rut INT;
	DECLARE v_bi_tu_choi INT;
	DECLARE v_thue INT;
	
	SET v_tong_tiep_nhan = (SELECT COUNT(*) 
					FROM t_r3_record r
                    INNER JOIN t_r3_record_type rt ON r.fk_record_type = rt.pk_record_type
					WHERE rt.C_SPEC_CODE = v_spec_code
					AND r.FK_VILLAGE_ID = 0);
					
	SET v_tong_tiep_nhan_trong_thang = (SELECT COUNT(*) 
						FROM t_r3_record r
						INNER JOIN t_r3_record_type rt ON r.fk_record_type = rt.pk_record_type
						WHERE MONTH(NOW())=MONTH(r.C_RECEIVE_DATE) 
						AND YEAR(NOW())=YEAR(r.C_RECEIVE_DATE)
						AND rt.C_SPEC_CODE = v_spec_code 
						AND r.FK_VILLAGE_ID = 0);
						
	SET v_dang_thu_ly = (SELECT COUNT(*)
				FROM view_processing_record r
				INNER JOIN t_r3_record_type rt ON r.fk_record_type = rt.pk_record_type
				WHERE r.C_BIZ_DAYS_EXCEED IS NULL
				AND (r.C_NEXT_TASK_CODE IS NOT NULL)
				AND r.C_CLEAR_DATE IS NULL
				AND rt.C_SPEC_CODE = v_spec_code
				AND r.C_IS_PAUSING <> 1
				AND r.FK_VILLAGE_ID = 0 );
				
	SET v_dang_cho_tra_kq = (SELECT COUNT(*)    
					FROM view_processing_record r
					INNER JOIN t_r3_record_type rt ON r.fk_record_type = rt.pk_record_type
					WHERE YEAR(r.C_RECEIVE_DATE)=YEAR(NOW())
					AND MONTH(r.C_RECEIVE_DATE)=MONTH(NOW())
					AND r.C_BIZ_DAYS_EXCEED IS NOT NULL
					AND r.C_CLEAR_DATE IS NULL
					AND rt.C_SPEC_CODE = v_spec_code
					AND r.FK_VILLAGE_ID = 0);
					
	SET v_da_tra_kq = (SELECT COUNT(*)    
				FROM t_r3_record r
				INNER JOIN t_r3_record_type rt ON r.fk_record_type = rt.pk_record_type
				WHERE YEAR(r.C_CLEAR_DATE)=YEAR(NOW())
				AND MONTH(r.C_CLEAR_DATE)=MONTH(NOW())
				AND r.C_CLEAR_DATE IS NOT NULL
				AND rt.C_SPEC_CODE = v_spec_code
				AND r.FK_VILLAGE_ID = 0);
				
	SET v_da_tra_kq_truoc_han = (SELECT COUNT(*)    
					FROM view_record r
					INNER JOIN t_r3_record_type rt ON r.fk_record_type = rt.pk_record_type
                    WHERE YEAR(r.C_CLEAR_DATE)=YEAR(NOW())
                    AND MONTH(r.C_CLEAR_DATE)=MONTH(NOW())
					AND r.C_CLEAR_DATE IS NOT NULL
					AND r.C_BIZ_DAYS_EXCEED > 0
					AND rt.C_SPEC_CODE = v_spec_code 
					AND r.FK_VILLAGE_ID = 0 
					AND r.C_REJECTED = 0);
					
	SET v_da_tra_kq_dung_han = (SELECT COUNT(*)    
					FROM view_record r
					INNER JOIN t_r3_record_type rt ON r.fk_record_type = rt.pk_record_type
					WHERE YEAR(r.C_CLEAR_DATE)=YEAR(NOW())
                    AND MONTH(r.C_CLEAR_DATE)=MONTH(NOW())
					AND r.C_CLEAR_DATE IS NOT NULL
					AND r.C_BIZ_DAYS_EXCEED = 0 
					AND rt.C_SPEC_CODE = v_spec_code 
					AND r.FK_VILLAGE_ID = 0
					AND r.C_REJECTED = 0);
					
	SET v_da_tra_kq_qua_han = (SELECT COUNT(*)    
					FROM view_record r
					INNER JOIN t_r3_record_type rt ON r.fk_record_type = rt.pk_record_type
					WHERE YEAR(r.C_CLEAR_DATE)=YEAR(NOW())
                    AND MONTH(r.C_CLEAR_DATE)=MONTH(NOW())
					AND r.C_CLEAR_DATE IS NOT NULL
					AND r.C_BIZ_DAYS_EXCEED < 0 
					AND rt.C_SPEC_CODE = v_spec_code
					AND r.FK_VILLAGE_ID = 0 
					AND r.C_REJECTED = 0);	
					
	SET v_dang_thu_ly_dung_tien_do = (SELECT COUNT(DISTINCT r.pk_record)    
						FROM view_processing_record r   
						INNER JOIN t_r3_record_type rt ON r.fk_record_type = rt.pk_record_type
						LEFT OUTER JOIN (SELECT fk_record, c_done FROM t_r3_record_supplement WHERE c_done = 0) rs
                        ON rs.FK_RECORD =r.PK_RECORD                                
						WHERE (DATEDIFF(NOW(), r.C_DOING_STEP_DEADLINE_DATE) <= 0)
						AND rs.FK_RECORD IS NULL
						AND (r.C_NEXT_TASK_CODE IS NOT NULL)
						AND r.C_BIZ_DAYS_EXCEED IS NULL
						AND (DATEDIFF(NOW(), r.C_RETURN_DATE) <= 0)
						AND rt.C_SPEC_CODE = v_spec_code
						AND r.C_IS_PAUSING <> 1
						AND r.FK_VILLAGE_ID = 0);	
	
	SET v_dang_thu_ly_cham_tien_do = (SELECT COUNT(DISTINCT r.pk_record)    
						FROM view_processing_record r
						INNER JOIN t_r3_record_type rt ON r.fk_record_type = rt.pk_record_type
						LEFT OUTER JOIN (SELECT fk_record, c_done FROM t_r3_record_supplement WHERE c_done = 0) rs
                        ON rs.FK_RECORD =r.PK_RECORD 
						WHERE (DATEDIFF(NOW(), r.C_DOING_STEP_DEADLINE_DATE) > 0)                                     
						AND (r.C_NEXT_TASK_CODE IS NOT NULL)
						AND rs.FK_RECORD IS NULL
						AND (DATEDIFF(NOW(), r.C_RETURN_DATE) <= 0)    
						AND r.C_BIZ_DAYS_EXCEED IS NULL
						AND rt.C_SPEC_CODE = v_spec_code
						AND r.C_IS_PAUSING <> 1
						AND r.FK_VILLAGE_ID = 0);	
						
	SET v_phai_bo_sung = (SELECT COUNT(DISTINCT r.PK_RECORD)    
						FROM t_r3_record_supplement rs
						LEFT JOIN view_processing_record r
						ON rs.FK_RECORD =r.PK_RECORD 
						INNER JOIN t_r3_record_type rt ON r.fk_record_type = rt.pk_record_type
						WHERE rs.C_DONE = 0 
						AND rs.C_RECEIVE_DATE IS NULL
						AND rt.C_SPEC_CODE = v_spec_code
						AND r.FK_VILLAGE_ID = 0);
	
	SET v_thu_ly_qua_han = (SELECT COUNT(DISTINCT r.pk_record)    
						FROM view_processing_record r
						INNER JOIN t_r3_record_type rt ON r.fk_record_type = rt.pk_record_type
                        LEFT OUTER JOIN (SELECT fk_record, c_done FROM t_r3_record_supplement WHERE c_done = 0) rs
                        ON rs.FK_RECORD =r.PK_RECORD 
						WHERE (DATEDIFF(NOW(), r.C_RETURN_DATE) > 0)                                     
						AND r.C_BIZ_DAYS_EXCEED IS NULL
						AND rs.FK_RECORD IS NULL
						AND rt.C_SPEC_CODE = v_spec_code
						AND r.FK_VILLAGE_ID = 0);
						
	SET v_cong_dan_rut = (SELECT COUNT(*)    
						FROM t_r3_record r
						INNER JOIN t_r3_record_type rt ON r.fk_record_type = rt.pk_record_type
						WHERE r.C_DELETED = 1
						AND MONTH(NOW()) = MONTH(r.C_CLEAR_DATE)
						AND YEAR(NOW()) = YEAR(r.C_CLEAR_DATE)                                     
						AND rt.C_SPEC_CODE = v_spec_code
						AND r.FK_VILLAGE_ID = 0);
						
	SET v_bi_tu_choi = (SELECT COUNT(*)    
						FROM t_r3_record r
						INNER JOIN t_r3_record_type rt ON r.fk_record_type = rt.pk_record_type
						WHERE r.C_REJECTED = 1
						AND MONTH(NOW()) = MONTH(r.C_CLEAR_DATE)
						AND YEAR(NOW()) = YEAR(r.C_CLEAR_DATE)                                     
						AND rt.C_SPEC_CODE = v_spec_code
						AND r.FK_VILLAGE_ID = 0);
						
	SET v_thue = (SELECT COUNT(*)    
						FROM view_processing_record r
						INNER JOIN t_r3_record_type rt ON r.fk_record_type = rt.pk_record_type
                        WHERE (
                            C_NEXT_TASK_CODE LIKE '%NOP_HO_SO_SANG_CHI_CUC_THUE'
                            OR C_NEXT_TASK_CODE LIKE '%NHAN_THONG_BAO_CUA_CHI_CUC_THUE'
